CREATE TABLE IF NOT EXISTS `prodaja` (
  `idprodaja` int(11) NOT NULL AUTO_INCREMENT,
  `datum` date DEFAULT NULL,
  `imeprezime` varchar(45) DEFAULT 'Nepoznato!?',
  `tip` varchar(45) DEFAULT 'Nepoznato!?',
  `kolicina` int(11) DEFAULT '0',
  `cijena` double DEFAULT '0',
  `nacinslanja` varchar(45) DEFAULT 'Nepoznato!?',
  `nacinpotraznje` varchar(45) DEFAULT 'Nepoznato!?',
  `prodavac` varchar(45) DEFAULT 'Nepoznato!?',
  `status` varchar(45) NOT NULL DEFAULT 'Ostalo',
  `info` varchar(150) DEFAULT 'Nepoznato!?',
  `datumizmjene` datetime DEFAULT '2015-01-01 00:00:00',
  `track_num` varchar(45) NOT NULL DEFAULT '',
  PRIMARY KEY (`idprodaja`)
) ENGINE=InnoDB AUTO_INCREMENT=1447 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `kupovina` (
  `idkupovina` int(11) NOT NULL AUTO_INCREMENT,
  `datumkupovine` datetime DEFAULT NULL,
  `datumstizanja` datetime DEFAULT NULL,
  `kolicina` int(11) DEFAULT '0',
  `cijena` double DEFAULT '0',
  `status` varchar(15) DEFAULT 'nepoznato',
  `tip` varchar(15) DEFAULT 'nepoznato',
  `track_num` varchar(25) DEFAULT '0',
  PRIMARY KEY (`idkupovina`)
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `korisnici` (
  `idkorisnici` int(11) NOT NULL AUTO_INCREMENT,
  `ime` varchar(45) DEFAULT NULL,
  `sifra` varchar(45) DEFAULT NULL,
  `imeprezime` varchar(10) DEFAULT NULL,
  `reg_id` varchar(1000) DEFAULT NULL,
  `pushNotif` varchar(10) NOT NULL DEFAULT 'false',
  PRIMARY KEY (`idkorisnici`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 COMMENT='Korisnici koji imaju pristup sistemu';

CREATE TABLE IF NOT EXISTS `todo` (
  `idtodo` bigint(250) NOT NULL AUTO_INCREMENT,
  `naslov` varchar(45) DEFAULT NULL,
  `opis` varchar(200) DEFAULT NULL,
  `status` varchar(10) DEFAULT NULL,
  `color` varchar(45) DEFAULT 'white',
  `datum` datetime NOT NULL,
  PRIMARY KEY (`idtodo`)
) ENGINE=InnoDB AUTO_INCREMENT=1465931610152 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `osobe` (
  `idosobe` int(11) NOT NULL AUTO_INCREMENT,
  `imeprezime` varchar(100) COLLATE utf8_bin NOT NULL,
  `status` varchar(10) COLLATE utf8_bin NOT NULL,
  `info` varchar(200) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`idosobe`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

CREATE TABLE IF NOT EXISTS `reklame` (
  `idreklame` int(11) NOT NULL AUTO_INCREMENT,
  `vrstaReklame` varchar(45) CHARACTER SET utf8 NOT NULL,
  `cijenaReklame` decimal(10,0) DEFAULT NULL,
  `pocetakReklame` datetime DEFAULT NULL,
  `krajReklame` datetime DEFAULT NULL,
  `vrijemeUnosa` datetime DEFAULT NULL,
  `info` varchar(155) COLLATE utf8_bin DEFAULT NULL,
  `reklamaZavrsena` varchar(10) COLLATE utf8_bin DEFAULT 'false',
  PRIMARY KEY (`idreklame`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;







